INSERT INTO `volunteer` VALUES (2,20,'f6b753','f7464c','ffffff','ffffff','ff9696','ffffff','코딩을 좋아하는 대학생 봉사자입니다. \n매일 18시 ~ 20시 [윤석코딩] 검색\n\n#JS #Vue #React #HTML #CSS ','2372885084','한윤석',_binary '\0'),(3,20,'40c8b6','e112b1','de1515','ff9696','100808','28e235','\n안녕하세요\n영어영문학과를 졸업한 김진호입니다.\n글로벌시대에 다같이 영어공부해봐요','2381659247','김진호',_binary '\0'),(7,0,'FFD89B','fffffb','FFAEAE','ff9696','ff9696','FFD89B','함께 하는 것이 최고의 힘 입니다 ~','2383911671','육나빈',_binary '\0'),(8,20,'FFD89B','fffffb','FFAEAE','ff9696','ff9696','FFD89B','선량한 봉사자인데용?','2384228341','조경은',_binary '\0'),(12,50,'FFD89B','fffffb','FFAEAE','ff9696','ff9696','FFD89B','안녕하세요. 아이들에게 책을 읽어주고 싶은 봉사자 입니다.','23870775440','정수정',_binary '\0'),(14,0,'FFD89B','fffffb','FFAEAE','ff9696','ff9696','FFD89B','인생 선배로써 많은 것을 알려줄 수 있습니다 ~ ^^',NULL,NULL,_binary '\0'),(33,20,'FFD89B','fffffb','FFAEAE','ff9696','ff9696','FFD89B','안녕하세요.','2374106678','김수빈',_binary '\0');

