INSERT INTO `classes` VALUES (1,'2022-08-19 18:00:00.000000','간단한 웹 게임 프로그래밍으로 쉽고 재미있게 \nHTML, CSS, JS 배워봐요',10,_binary '\0',NULL,0,'2022-08-19 16:00:00.000000','data:image/jpg;base64,','쉽고 재밌게 코딩 배워볼래요?',2),(2,'2022-08-26 21:33:00.000000','JPA 어렵지 않아요',30,_binary '\0',NULL,0,'2022-08-26 21:33:00.000000','data:image/png;base64,','다빈의 JPA 첫걸음',3),(3,'2022-08-23 17:30:00.000000','수도 퀴즈를 통해 전 세계 나라와 친해지기',10,_binary '\0',NULL,1,'2022-08-23 16:00:00.000000','data:image/jpg;base64,','서울 도쿄 베이징 워싱턴 아테네 암스테르담 오슬로 리우 리스본',2),(4,'2022-08-20 16:00:00.000000','올 겨울 뜨뜻하고 든든한 겨울 목도리 만들기 위한 뜨개질 배워볼 학생들 신청해주세요.\n주 3회 2시간씩 같이 만들면 김고은 목도리 뺨치는 목도리 만들 수 있어요!',6,_binary '\0',NULL,0,'2022-08-20 14:00:00.000000','data:image/jpg;base64,','뜨뜻하고 든든한 목도리 만들기',2),(5,'2022-08-20 18:00:00.000000','16:00 ~ 17:00 애니메이션 감상\n17:00 ~ 18:00 애니메이션 감상 후기 공유 및 설명회',15,_binary '\0',NULL,0,'2022-08-20 16:00:00.000000','data:image/jpg;base64,','애니메이션의 이해',2),(6,'2022-08-17 14:00:00.000000','회화연습을 통해 외국인 친구를 사귀어 봐요',1,_binary '\0',NULL,0,'2022-08-17 09:00:00.000000','data:image/png;base64,','영어 회화 1:1 수업',3),(7,'2022-08-19 15:33:00.000000','이 강의만 들으면 너두 할수있다',10,_binary '\0',NULL,0,'2022-08-19 12:33:00.000000','data:image/jpeg;base64,','나두 100만 유튜버 될래',8);
INSERT INTO `classes` VALUES (8,'2022-08-24 14:00:00.000000','요즘 유행하는 아이돌의 춤을 배워보아요',5,_binary '\0',NULL,0,'2022-08-24 13:30:00.000000','data:image/jpg;base64,','신나는 방송댄스 - 스니커즈',12),(10,'2022-08-19 22:00:00.000000','매일 선택해온 시를 번갈아가며 한 편씩 읽는 활동을 할거에요. 시와 더 친해지고 즐겁게 읽을 수 있는 시간이 되었으면 좋겠어요',10,_binary '',NULL,1,'2022-08-19 21:00:00.000000','data:image/jfif;base64,','시 낭송 활동',2),(13,'2022-08-20 22:00:00.000000','축구를 통해 몸과 정신 건강을 챙겨봐요',20,_binary '\0',NULL,0,'2022-08-20 09:00:00.000000','data:image/jpg;base64,','김진호의 축구교실',3),(15,'2022-08-24 18:24:00.000000','달달한 초코케이크를 만들어볼거예요!',5,_binary '\0',NULL,0,'2022-08-24 13:24:00.000000','data:image/jfif;base64,','베이킹 클래스',8),(16,'2022-08-20 23:00:00.000000','숫자 카드를 통해 재미있게 수학을 배워보는 시간입니다.\n\n확률과 통계를 누구보다 쉽고 빠르게 알려주는 윤석쌤과 함께 시간 보내요',20,_binary '\0',NULL,0,'2022-08-20 10:00:00.000000','data:image/png;base64,','카드로 배우는 확률 수학',2),(18,'2022-08-29 12:27:00.000000','권박사의 야구교실 \n야구선수가 되는 첫걸음\n',10,_binary '\0',NULL,0,'2022-08-29 09:27:00.000000','data:image/png;base64,','권박사의 야구교실',3),(19,'2022-08-23 22:30:00.000000','한번 알아두면 성인되서 도움되는 국군도수체조\n함께 배워봐요',10,_binary '\0',NULL,0,'2022-08-23 19:00:00.000000','data:image/jpg;base64,','한윤석의 국군도수체조 배우기',2),(20,'2022-08-23 22:29:00.000000','SSAFY 7기가 말해주는 개발자되는법',1000,_binary '\0',NULL,0,'2022-08-23 10:29:00.000000','data:image/png;base64,','개발자 되어보기',3),(21,'2022-08-24 18:00:00.000000','최고심처럼 이모티콘 만들기',3,_binary '\0',NULL,0,'2022-08-24 14:00:00.000000','data:image/jpg;base64,','이모티콘 귀엽게만드는법',8);
INSERT INTO `classes` VALUES (22,'2022-08-22 16:30:00.000000','초등학생을 위해 책을 읽는 방법, 책을 읽고 의견을 나누는 방법을 알려주는 수업입니다. 매주 읽을 책이 지정됩니다.',10,_binary '\0',NULL,0,'2022-08-22 15:00:00.000000','data:image/jpg;base64,','초등학생을 위한 독서논술',12),(23,'2022-08-22 14:00:00.000000','제기차기 10개 이상 차는 법.\n 한번 알아두면 매 년 운동회 때 써먹을 수 있는 그 기술!\n지금 바로 전수해드립니다.',10,_binary '',NULL,0,'2022-08-22 12:00:00.000000','data:image/jpg;base64,','윤석의 제기차기 수업',2),(24,'2022-08-26 23:31:00.000000','친구와 사이좋게 지내요',50,_binary '\0',NULL,0,'2022-08-26 22:31:00.000000','data:image/jpg;base64,','친구와 사이좋게 지내는법',3),(28,'2022-08-24 21:34:00.000000','스마트폰 사용법\n',100,_binary '\0',NULL,0,'2022-08-24 21:34:00.000000','data:image/jpg;base64,','삼성 휴대폰 사용법',3),(30,'2022-08-26 15:00:00.000000','부루마블\n다비치코드\n젠가\n같이해요 ',8,_binary '\0',NULL,0,'2022-08-26 14:00:00.000000','data:image/jpg;base64,','윤석의 보드게임 같이해요',2),(31,'2022-08-25 11:39:00.000000','봉사활동 준비물 공지',100,_binary '',NULL,2,'2022-08-25 23:38:00.000000','data:image/jpg;base64,','삼성과 함께하는 봉사활동',3),(34,'2022-08-24 21:44:00.000000','삼성과 함께하는 언텍트 봉사활동 ',1000,_binary '',NULL,0,'2022-08-24 21:44:00.000000','data:image/png;base64,','삼성과 함께하는 봉사활동',3);

